import "./App.css";

function App() {
  return (
    <div className="App">
      <div>
        <input type="text" placeholder="Nome"></input>
        <input type="text" placeholder="URL"></input>
        <input type="text" placeholder="Contato"></input>
      </div>
    </div>
  );
}

export default App;
